window.onload=function(){$("#results").scrollTop($("#results").prop("scrollHeight"));if(localStorage&&localStorage.iMagineUID){uid=Number(localStorage.iMagineUID)}else{uid=Math.floor(Math.random()*100000);localStorage.iMagineUID=uid}if(localStorage&&localStorage.iMagineResults){$("#results").val(localStorage.iMagineResults)}};function reload(){$("#results").val($("#results").val()+"\n>"+$("#contents").val());var a=$("#contents").val();$("#contents").val("");var b=false;if(a==="help"){window.location.replace("help.html");b=true}if(a==="reset"){localStorage.iMagineUID=null;localStorage.iMagineResults=null;window.location.reload();b=true}if(localStorage){localStorage.iMagineResults=$("#results").val()}if(!b){$.get("http://i.magine.tk/head.php","command="+a+"&uid="+uid,function(c){$("#results").val($("#results").val()+"\n"+c.response);$("#results").scrollTop($("#results").prop("scrollHeight"));$("#tony_energy").val(c.tony_energy);$("#edyn_energy").val(c.edyn_energy);$("#strag_energy").val(c.strag_energy);$("#tony_energy_disp").html(c.tony_energy);$("#edyn_energy_disp").html(c.edyn_energy);$("#strag_energy_disp").html(c.strag_energy);console.log(c);$("#errors").html(c.errors);if(localStorage){localStorage.iMagineResults=$("#results").val()}},"json").fail(function(c){console.log(c);$("#errors").html(c.responseText);$("#contents").val("")})}};